ount = msg.value * rate;    //msg.value , amount of ether\r\n        //require that EthSwap has enough tokens\r\n        require(token.balanceOf(address(this)) >= tokenAmount);\r\n        //transfer tokens to the user\r\n        token.transfer(msg.sender, tokenAmount);\r\n\r\n        //Emit an event\r\n        emit TokensPurchased(msg.sender, address(token), tokenAmount, rate);\r\n    }\r\n\r\n    function sellTokens(uint _amount) public {\r\n        //User can't sell more tokens than they have\r\n        require(token.balanceOf(msg.sender) >= _amount);\r\n\r\n        //Calculate the amount of ether to redeem\r\n        uint etherAmount = _amount / rate;\r\n\r\n        //Require that EthSwap has enough Ether\r\n        require(address(this).balance >= etherAmount);\r\n\r\n        // Perfom sale\r\n        token.transferFrom(msg.sender, address(this), _amount);\r\n        msg.sender.transfer(etherAmount);\r\n\r\n        //Emit an event\r\n        emit TokensSold(msg.sender, address(token), _amount, rate);\r\n\r\n    }\r\n}\r\n",sourcePath:"/home/livesetup/Desktop/Trufeedback/Blockchain/MyContract/src/contracts/EthSwap.sol",ast:{absolutePath:"project:/src/contracts/EthSwap.sol",exportedSymbols:{EthSwap:[141]},id:142,nodeType:"SourceUnit",nodes:[{id:1,literals:["solidity","0.5",".16"],nodeType:"PragmaDirective",src:"2:23:0"},{absolutePath:"project:/src/contracts/Token.sol",file:"./Token.sol",id:2,nodeType:"ImportDirective",scope:142,sourceUnit:323,src:"29:21:0",symbolAliases:[],unitAlias:""},{baseContracts:[],contractDependencies:[],contractKind:"contract",documentation:null,fullyImplemented:!0,id:141,linearizedBaseContracts:[141],name:"EthSwap",nodeType:"ContractDefinition",nodes:[{constant:!1,id:5,name:"name",nodeType:"VariableDeclaration",scope:141,src:"78:47:0",stateVariable:!0,storageLocation:"default",typeDescriptions:{typeIdentifier:"t_string_storage",typeString:"string"},typeName:{id:3,name:"string",nodeType:"ElementaryTypeName",src:"78:6:0",typeDescriptions:{t